import tensorflow as tf
import numpy as np
import base64
from PIL import Image
from io import BytesIO
import cv2

def decode_base64_image(base64_str):
    image_data = base64.b64decode(base64_str)
    image = Image.open(BytesIO(image_data))
    image = image.convert("RGB")
    image = image.resize((224, 224))
    return np.array(image) / 255.0

training_data = [
    ('', 1),
    ('', 1),
]

X_train = []
y_train = []
for base64_image, label in training_data:
    img = decode_base64_image(base64_image)
    X_train.append(img)
    y_train.append(label)

X_train = np.array(X_train)
y_train = np.array(y_train)

split = int(len(X_train) * 0.8)
X_train, X_val = X_train[:split], X_train[split:]
y_train, y_val = y_train[:split], y_train[split:]

train_dataset = tf.data.Dataset.from_tensor_slices((X_train, y_train)).batch(32).prefetch(tf.data.AUTOTUNE)
val_dataset = tf.data.Dataset.from_tensor_slices((X_val, y_val)).batch(32).prefetch(tf.data.AUTOTUNE)

mobilenet = tf.keras.applications.MobileNetV3Large(
    input_shape=(224, 224, 3),
    include_top=False,
    pooling='avg',
    weights='imagenet'
)

mobilenet.trainable = True
for layer in mobilenet.layers:
    if isinstance(layer, tf.keras.layers.BatchNormalization):
        layer.trainable = False

model = tf.keras.Sequential([
    mobilenet,
    tf.keras.layers.Dense(1, activation='sigmoid')
])

model.compile(optimizer=tf.keras.optimizers.Adam(learning_rate=0.0001),
              loss='binary_crossentropy',
              metrics=['accuracy'])

model.fit(train_dataset, epochs=10, validation_data=val_dataset)

model.save('object_detection_model.keras')

def predict_object(frame):
    img = cv2.resize(frame, (224, 224))
    img = np.expand_dims(img, axis=0)
    prediction = model.predict(img)
    confidence = float(prediction[0][0])
    if confidence > 0.5:
        print(f"Object is present with confidence {confidence:.2f}")
    else:
        print(f"Object is not present with confidence {confidence:.2f}")

model = tf.keras.models.load_model('object_detection_model.keras')

cap = cv2.VideoCapture(0)

while True:
    ret, frame = cap.read()
    if not ret:
        break

    predict_object(frame)

    cv2.imshow('Camera Feed', frame)

    if cv2.waitKey(1) & 0xFF == ord('q'):
        break

cap.release()
cv2.destroyAllWindows()
